import React from 'react';
import '../styles/style.css'; 

import janelaProdutos from '../assets/janelaProdutos.png';
import portaProdutos from '../assets/portaProdutos.png';
import sacadaProdutos from '../assets/sacadaProdutos.png';
import espelhoProdutos from '../assets/espelhoProdutos.png';


const Products = () => {
  return (
    <div className="links-container">
      <div className="diagonal-photos">
        {/* Insira suas fotos aqui */}
        <img src={janelaProdutos} alt="Produto 1" />
        <img src={portaProdutos} alt="Produto 2" />
        <img src={sacadaProdutos} alt="Produto 3" />
        <img src={espelhoProdutos} alt="Produto 4" />
        
      </div>
      <div className="product-links">
        <a href="/produto/1">Produto 1</a>
        <a href="/produto/2">Produto 2</a>
        <a href="/produto/3">Produto 3</a>
      </div>
    </div>
  );
};

export default Products;
